const ImageGridListStyle = {
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	},
	gridList: {
		width: "100%",
		height: "auto"
	},
	gridImg: {
		width: "100% !important",
		height: "100% !important"
	},
	imageSrc: {
		width: "100%",
		height: "100%",
		padding: "10px",
		paddingBottom: "20px",
		marginBottom: "12px"
	},
};

export default ImageGridListStyle;
